                              "name": "MerchantAccount",
                              "description": "A person or company that sells goods or services.\n A merchant works with an Acquiring Bank to apply for and receive a Merchant Account (an account that allows the Merchant to accept Credit and debit cards). Whenever a customer purchases an item with a Credit or debit card, the Merchant submits the purchase Transaction information to its Acquiring Bank, which will then submit it through the card association network to the card holder's Issuing Bank. The Issuing Bank will approve or decline the charge, and bill the cardholder the amount due to the Merchant.",
