// --- GEMINI API INTEGRATION ---
const callGeminiAPI = async (prompt) => {
  const apiKey = "AIzaSyDlvfTR38CyT2dTDLfU_0IHv3M9M2ACiIU"; 
  const url = `https://generativelanguage.googleapis.com/v1beta/models/gemini-2.5-flash-preview-09-2025:generateContent?key=${apiKey}`;

  try {
    const response = await fetch(url, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ contents: [{ parts: [{ text: prompt }] }] })
    });

    if (!response.ok) throw new Error('API Hatas');
    const data = await response.json();
    return data.candidates?.[0]?.content?.parts?.[0]?.text || "Yant alnamad.";
  } catch (error) {
    console.error("Gemini API Error:", error);
    return "zgnm, u anda AI servisine eriilemiyor. Ltfen daha sonra tekrar deneyin.";
  }
};

// --- HELPER FUNCTIONS ---

const generateXMLString = (node, indent = 0) => {
  const spaces = '  '.repeat(indent);
  let xml = `${spaces}<${node.name}`;
  if (node.attributes) {
    Object.entries(node.attributes).forEach(([key, value]) => {
      xml += ` ${key}="${value}"`;
    });
  }
  if (!node.children || node.children.length === 0) {
    xml += ` />\n`;
  } else {
    xml += `>\n`;
    node.children.forEach(child => {
      xml += generateXMLString(child, indent + 1);
    });
    xml += `${spaces}</${node.name}>\n`;
  }
  return xml;
};

const findPathChain = (node, targetId, currentChain = []) => {
  const newChain = [...currentChain, node];
  if (node.id === targetId) return newChain;
  
  if (node.children) {
    for (const child of node.children) {
      const result = findPathChain(child, targetId, newChain);
      if (result) return result;
    }
  }
  return null;
};

const getAllNodeIds = (node) => {
  let ids = [node.id];
  if (node.children) {
    node.children.forEach(child => {
      ids = ids.concat(getAllNodeIds(child));
    });
  }
  return ids;
};

const findNodeAndPath = (node, keyword, currentPath = "") => {
  const myPath = currentPath ? `${currentPath}/${node.name}` : node.name;
  let results = [];
  const lowerKeyword = keyword.toLowerCase();
  const lowerPath = myPath.toLowerCase();
  
  const matchName = node.name && node.name.toLowerCase().includes(lowerKeyword);
  const matchDesc = node.description && node.description.toLowerCase().includes(lowerKeyword);
  const matchId = node.id && node.id.toLowerCase().includes(lowerKeyword);
  const matchPath = lowerPath.includes(lowerKeyword);

  if (matchName || matchDesc || matchId || matchPath) {
    results.push({ node, path: myPath });
  }

  if (node.children) {
    node.children.forEach(child => {
      results = [...results, ...findNodeAndPath(child, keyword, myPath)];
    });
  }
  return results;
};

