const TreeNode = ({ node, level, onSelect, selectedNodeId, expandedIds, onToggleExpand }) => {
  const isOpen = expandedIds.has(node.id);
  const hasChildren = node.children && node.children.length > 0;
  
  const handleToggle = (e) => {
    e.stopPropagation();
    onToggleExpand(node);
  };

  const isSelected = selectedNodeId === node.id;
  const isContainer = hasChildren;

  return (
    <div className="select-none">
      <div 
        className={`flex items-center py-1.5 px-2 cursor-pointer rounded-md transition-all duration-200 border-l-2 ${isSelected ? 'bg-blue-50 text-blue-700 border-blue-600 shadow-sm' : 'hover:bg-slate-50 text-slate-600 border-transparent hover:border-slate-300'}`}
        style={{ paddingLeft: `${level * 16 + 8}px` }}
        onClick={() => onSelect(node)}
      >
        <span 
          onClick={hasChildren ? handleToggle : undefined}
          className={`mr-1.5 p-0.5 rounded hover:bg-black/5 transition-colors ${hasChildren ? 'opacity-100' : 'opacity-0'}`}
        >
          {isOpen ? <ChevronDown size={14} className="text-slate-500" /> : <ChevronRight size={14} className="text-slate-400" />}
        </span>
        
        {isContainer ? (
           <FolderTree size={16} className={`mr-2 ${isSelected ? 'text-blue-500' : 'text-slate-400'}`} />
        ) : (
           <Tag size={16} className={`mr-2 ${isSelected ? 'text-blue-500' : 'text-slate-400'}`} />
        )}
        
        <span className={`text-sm truncate ${isSelected ? 'font-semibold' : 'font-medium'}`}>
          {node.name}
        </span>
      </div>

      {hasChildren && isOpen && (
        <div>
          {node.children.map((child) => (
            <TreeNode 
              key={child.id} 
              node={child} 
              level={level + 1} 
              onSelect={onSelect}
              selectedNodeId={selectedNodeId}
              expandedIds={expandedIds}
              onToggleExpand={onToggleExpand}
            />
          ))}
        </div>
      )}
    </div>
  );
};

